import './App.css';
import NavBar from './Components/NavBar';

const Home = () => {
  return(
    <>
      <h1>Hello World from React 201</h1>
    </>
  )
}

function App() {
  return (
    <div>
      <NavBar />
      <Home />
    </div>
  );
}

export default App;
